webpackJsonp([0x61ee3f352079],{9134:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Cool and Windy",date:"12 Aug 2001",slug:"/2001-08-12-cool-and-windy/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/08/syltheide.jpg" height="225" width="300" border="0" alt="syltheide.jpg: " /></p>\n<p>We\'re back! We didn\'t exactly have ideal beach weather (and we were cut off from the Internet) but we had a good time nonetheless. </p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/08/syltkoerbe.jpg" height="225" width="300" border="0" alt="syltkoerbe.jpg: " /></p>\n<p>Pictures from our week at Sylt are <a href="http://www.shcon.com/index.php?album=08_2001%2F20010812_sylt&dispsize=512">here</a>.</p>\n<p><b>FC St. Pauli</b> <a href="http://www.bundesliga.de/en/bundesliga/2001/03/01735/nachbericht.shtml?">lost at home in the rain to Rostock 1-0</a>. They now have 2 points in 3 games for 14th place. They\'ll likely need 40 points in 34 games to keep from being demoted.</p>'},next:{fields:{title:"Back in Black",date:"04 Aug 2001",slug:"/2001-08-04-back-in-black/"}},previous:{fields:{title:"Yellow Eyes",date:"13 Aug 2001",slug:"/2001-08-13-yellow-eyes/"}}},{node:{fields:{title:"Back in Black",date:"04 Aug 2001",slug:"/2001-08-04-back-in-black/",tags:"Y2001"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2001/08/crhentrywaygrin.jpg" height="262" width="300" border="0" alt="crhentrywaygrin.jpg: " /></p>\n<p>We\'re off to Sylt on the North Sea tomorrow morning. We may or may not get around to making postings. If not, we\'ll be back next Saturday.</p>\n<p><b>FC St. Pauli</b> <a href="http://www.bundesliga.de/en/bundesliga/2001/02/01720/nachbericht.shtml?">tied 1-1 in Wolfsburg</a>. They now have 2 points in 2 games for 11th place.</p>'},next:{fields:{title:"Mouse that Roared",date:"02 Aug 2001",slug:"/2001-08-02-mouse-that-roared/"}},previous:{fields:{title:"Cool and Windy",date:"12 Aug 2001",slug:"/2001-08-12-cool-and-windy/"}}},{node:{fields:{title:"Mouse that Roared",date:"02 Aug 2001",slug:"/2001-08-02-mouse-that-roared/",tags:"Y2001"},html:"<p>Christopher and I are doing better today. We need a vacation, though. Good thing that it starts already on Saturday.</p>"},next:{fields:{title:"Video Killed the Radio Star",date:"01 Aug 2001",slug:"/2001-08-01-video-killed-the-radio-star/"}},previous:{fields:{title:"Back in Black",date:"04 Aug 2001",slug:"/2001-08-04-back-in-black/"}}}],pathPrefix:"",first:!1,last:!1,index:985,pageCount:1101}}}});
